import React from 'react';

const Navigation = () => (
    <ul>
        <li><a href="/">Twitters</a></li>
        <li><a href="/Articles">Articles</a></li>
        <li><a href="/Notes">Notes</a></li>
    </ul>
);

export default Navigation;
